                  "description": "<p>Контроллер Sigur E900U предназначен для управления различными типами устройств - дверьми, турникетами, шлагбаумами, воротами и прочими. Отличительными особенностями контроллера является расширенный температурный режим, а также большой объем внутренней энергонезависимой памяти. Все правила доступа реализуются контроллером автономно.</p>\r\n\r\n<p>В зависимости от настроек одним контроллером возможно одновременное управление 4 точками прохода. Типы устройств при этом можно гибко комбинировать: например, одновременно управлять дверью и турникетом, двумя турникетами, четырьмя дверьми и так далее.</p>\r\n\r\n<p>Дополнительное оборудование: картоприемники, алкотестеры, светофоры и прочие, - подключается напрямую к контроллеру. Для это не нужны платы сопряжения или подобные устройства.&nbsp;<br />\r\n&nbsp;</p>",
